function upload(){var n=document.getElementById("selector");n.onchange=()=>{n.value!=undefined&&n.value!=null&&n.value!=""&&document.getElementById("submit").click()};n.click()}function fromUrl(n){var i=document.getElementById("currentUrl").value,t=prompt("请输入url",i),r="/Admin/Bgm/SetBgmType?bgmType="+n;t!=null&&t!=""&&$.ajax({type:"POST",url:r,data:{url:t},success:function(){window.location.reload()}})}function play(n){var t="/Admin/Bgm/Play?musicName="+n;document.getElementById("player").src=t}